/*** Calculate ***/
void test_calculate_1(void)
{
    /*** Calculate (Configuration NULL) ***/
    /* Variable */
    uint8_t data[1];

    /* Calculate */
    TEST_ASSERT_EQUAL_HEX64(0x0000000000000000, crc64_calculate(NULL, data, sizeof(data)));
}

void test_calculate_2(void)
{
    /*** Calculate (Data NULL) ***/
    /* Variable */
    crc64_configuration_t configuration;
    uint8_t data[1];

    /* Calculate */
    TEST_ASSERT_EQUAL_HEX64(0x0000000000000000, crc64_calculate(&configuration, NULL, sizeof(data)));
}

void test_calculate_3(void)
{
    /*** Calculate (Loop) ***/
    /* Constant */
    const char *CrcName[] = {"CRC-64", "CRC-64/ECMA-182", "CRC-64/GO-ECMA", "CRC-64/GO-ISO", "CRC-64/MS", "CRC-64/NVME", "CRC-64/REDIS", "CRC-64/WE", "CRC-64/XZ"};
    const size_t CrcNameCount = sizeof(CrcName) / sizeof(CrcName[0]);

    /* Variable */
    crc64_configuration_t configuration;
    uint64_t crc;

    /* Calculate */
    for(size_t i = 0; i < CrcNameCount; i++)
    {
        /* Initialize */
        crc64_init(CrcName[i], &configuration, false); // false (Loop)

        /* Calculate */
        crc = crc64_calculate(&configuration, test_CheckData, sizeof(test_CheckData));

        /* Verify */
        TEST_ASSERT_EQUAL_HEX64(configuration.check, crc);
    }
}

