        /* Set Up */
        memory = malloc(CRC64_LOOKUP_TABLE_MEMORY_SIZE);

        /* Mock */
        memory_malloc_ExpectAndReturn(CRC64_LOOKUP_TABLE_MEMORY_SIZE, memory);

        /* Initialize */
        crc64_init(CrcName[i], &configuration, true); // true (Lookup Table)

